import React, { useState, useEffect } from 'react'
import { getTx } from '../../api'
import Nav from '../nav'
function index() {
    useEffect(() => {
        const a = window.location.pathname
        var reg = /(?=\/)/g;
        var utld = null
        a.replace(reg, ($, $1) => {
            utld = a.slice($1 + 1)
        })
        // console.log(utld);
        const txfn = async () => {
            const result = await getTx(utld)
            console.log(result);
        }
        txfn()
    }, [])
    return (
        <div className='tx-box'>
            <Nav></Nav>
            sdsdsd
        </div>
    )
}

export default index
